function fearNotLetter(str) {
  /*Find the missing letter in the passed letter range and return it.

  If all letters are present in the range, return undefined.*/

  //declare variables
  let start;
  let end;
  let codeStr=[];
  let finalStr=[];

  //find start and end character
  start=str.charCodeAt(0);
  end=str.charCodeAt(str.length-1);

  //check if no missing
  if (Number(end)-Number(start) == str.length-1) {
    console.log('nothing missing');
    return undefined;
  }

  //push every missing character code to codeStr
  for (let i=Number(start); i<=Number(end); i++) {
    codeStr.push(i);
  }

  //change codes to letters
  codeStr.forEach((element) => {
    finalStr.push(String.fromCharCode(element));
  });

  //join array
  finalStr=finalStr.join('');

  //
  for (let i=0;i<finalStr.length;i++) {
    if (str.includes(finalStr[i])) {
      console.log("str has a "+finalStr[i]);
    } else {
      console.log("str is missing a "+finalStr[i]);
      return finalStr[i];
    }
  }
}

